window.bookSummaryJSON = "<p><b>Kidnapped and sent sailing by his own girlfriend.</b></p> <p>Clyde Hatchett hadn't planned on running away to become a pirate - that's just what happened. Now he's on a seaside mission far from Glaton, desperate to find the only mage capable of freeing Clyde from the corpse-king taking over his body. Get ready for a nonstop joyride full of secrets, betrayal, loot - and mermaids!</p> <p>Oh and on the way, Clyde will have to rescue his tjene's sister from marrying a murderous slave owner.</p> <p>The winds of ill-fortune may be blowing directly at Clyde, but our down-on-his luck rogue assembled the best team in the business to help him succeed: a libertine swordsman who keeps getting arrested, a mohawked captain whose crew is perpetually on the brink of mutiny, and a salty old seadog who's very nice and has a lot of...well, he's very nice, and that has to count for something, right? Add Hellion the mimic and Grim the little grimeling to the mix, and there's no stopping this dream team.</p> <p>Not even the mermaids.</p>"; 
